import React, { useState } from "react";

function App() {
  const [skills, setSkills] = useState("");
  const [interest, setInterest] = useState("tech");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const [jobListings, setJobListings] = useState([]);
  const [jobsLoading, setJobsLoading] = useState(false);

  const fetchJobs = async (keyword) => {
    setJobsLoading(true);
    try {
      const response = await fetch(`http://127.0.0.1:8000/adzuna/jobs?keyword=${encodeURIComponent(keyword)}`);
      const data = await response.json();
      if (data.jobs) {
        setJobListings(data.jobs);
      } else {
        setJobListings([]);
      }
    } catch (error) {
      console.error("Failed to fetch jobs:", error);
      setJobListings([]);
    }
    setJobsLoading(false);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResult(null);
    setJobListings([]);

    const inputData = {
      skills: skills.split(",").map((s) => s.trim().toLowerCase()),
      interests: [interest.toLowerCase()],
    };

    try {
      const response = await fetch("http://127.0.0.1:8000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(inputData),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.detail || "Server error");
      }

      const data = await response.json();
      setResult(data.recommendation);

      if (data.recommendation && data.recommendation.length > 0) {
        await fetchJobs(data.recommendation[0].career);
      }
    } catch (error) {
      console.error("Prediction failed:", error);
      setResult([{ career: "Error", fit: 0 }]);
    }

    setLoading(false);
  };

  return (
    <div className="p-8 bg-gray-900 min-h-screen text-white font-sans">
      <h1 className="text-3xl font-bold mb-6 text-purple-400">Skillmap AI — Career Predictor</h1>

      <form onSubmit={handleSubmit} className="mb-6">
        {/* Skills input */}
        <label className="block mb-2 text-gray-300">Skills (comma-separated):</label>
        <input
          type="text"
          value={skills}
          onChange={(e) => setSkills(e.target.value)}
          placeholder="e.g. python, programming"
          required
          className="w-full p-3 rounded bg-gray-800 border border-gray-700 mb-4 focus:outline-none focus:ring-2 focus:ring-purple-400"
        />

        {/* Interest select */}
        <label className="block mb-2 text-gray-300">Interests:</label>
        <select
          value={interest}
          onChange={(e) => setInterest(e.target.value)}
          className="w-full p-3 rounded bg-gray-800 border border-gray-700 mb-4 focus:outline-none focus:ring-2 focus:ring-purple-400"
        >
          <option value="tech">Tech</option>
          <option value="business">Business</option>
          <option value="art">Art</option>
          <option value="marketing">Marketing</option>
        </select>

        <button
          type="submit"
          disabled={loading}
          className="bg-purple-600 hover:bg-purple-700 px-6 py-3 rounded text-white font-semibold transition duration-200"
        >
          {loading ? "Loading..." : "Get Career Recommendation"}
        </button>
      </form>

      {/* Career Recommendations */}
      {result && (
        <div>
          <h2 className="text-2xl font-semibold text-purple-400 mb-4">Recommended Careers:</h2>
          <ul>
            {result.map((item, idx) => (
              <li key={idx} className="mb-2">
                <strong>{item.career}</strong> — Fit Score: {item.fit.toFixed(2)}%
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Job Listings Section */}
      {jobsLoading && <p className="text-gray-400 mt-4">Loading jobs...</p>}

      {!jobsLoading && jobListings.length > 0 && (
        <div className="mt-8 bg-gray-800 p-6 rounded-lg shadow-lg">
          <h2 className="text-xl font-semibold mb-4 text-purple-400">Job Listings</h2>
          <ul className="space-y-4">
            {jobListings.map((job, idx) => (
              <li key={idx} className="bg-gray-700 p-4 rounded-lg">
                <h3 className="font-semibold text-white text-lg">{job.title}</h3>
                <p className="text-gray-300">{job.company?.display_name || "Unknown Company"}</p>
                <p className="text-gray-400 text-sm">{job.location?.display_name || "Unknown Location"}</p>
                <a
                  href={job.redirect_url}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="inline-block mt-2 text-purple-400 hover:underline"
                >
                  View Job →
                </a>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
